 определить условия поиска в порядке релевантности.','Content Protection'=>'Защита содержимого','Prevent concurrent logins'=>'Запретить одновременный вход','Prevent users from copying website content and downloading images.'=>'Запретить пользователям копировать содержимое сайта и скачивать изображения.','[DELETED ITEM]'=>'[УДАЛЕННЫЙ ПУНКТ]','Recurring charge aborted because the purchased product does not exist anymore.'=>'Регулярная оплата отменена, поскольку купленный продукт больше не существует.','[DELETED]'=>'[УДАЛЕНО]','Sorry, you are not allowed to delete %s with active subscriptions.'=>'Вам не разрешено удалять %s с активными подписками.','This question has been deleted'=>'Вопрос удален','For internal use only, not visible to the customer.'=>'Только для внутреннего использования (не доступен для пользователей).','Order Note'=>'Примечание к заказу','Modify Remaining Payments'=>'Изменить добавленные платежи','Remaining payments'=>'Добавленные платежи','Remaining Payments:'=>'Добавленные платежи:','Download CSV'=>'Скачать CSV','There is %d order that should be reviewed.'=>'Остался %d заказ, требующий внимания.' . "\0" . 'Осталось %d заказов, требующих внимания.' . "\0" . 'Осталось %d заказов, требующих внимания.','Edit gateway information'=>'Изменить информацию о шлюзе','Add additional payments'=>'Добавить дополнительные способы оплаты','Limited Billing Orders'=>'Ограниченные биллинговые заказы','The billing length of the order has been modified from %1$d %2$s to %3$d %4$s.'=>'Срок выставления счета по заказу был изменен с %1$d %2$s на %3$d %4$s.','The method used to determine when a limited-billing recurring order has completed its payment plan changed during version 5.3.0. This tool provides a report of orders which may been affected by this change. %1$sRead more%2$s about this change.'=>'В версии 5.3.0 изменился метод, используемый для определения того, когда лимитированный повторяющийся заказ завершил свой план платежей. Этот инструмент предоставляет отчет о заказах, которые могли быть затронуты этим изменением. %1$sЧитайте больше %2$s об этом изменении.','Upcoming Subscription Payment'=>'Предстоящая оплата подписки','Upcoming payment reminder for your subscription to %1$s'=>'Напоминание о предстоящем платеже для вашей подписки на %1$s','You will be charged for your subscription to %1$s on %2$s.'=>'С вас будет взиматься плата за подписку %1$s на %2$s.','Select a recurring order'=>'Выбор повторного заказа','The number of days before the upcoming payment due date when to notify the customer.'=>'Количество дней до наступления срока платежа, о котором следует уведомить покупателя.','Reminder days'=>'Напоминания дней','Upcoming Payment Reminder'=>'Напоминание о предстоящем платеже','Next recurring payment due date is not valid'=>'Дата следующего регулярного платежа недействительна','You are not allowed to perform the requested action.'=>'Вам не разрешено выполнять запрошенное действие.','Your database is being upgraded in the background. Feel free to leave this page. A notice like this will appear when the update is complete.'=>'Ваша база данных обновляется в фоновом режиме. Вы можете покинуть эту страницу. Подобное уведомление появится после завершения обновления.','Upcoming payment reminder passed'=>'Напоминание о предстоящем платеже отправлено','Send yourself a test notification using information from the selected recurring order.'=>'Отправьте себе тестовое уведомление, используя информацию из выбранного повторяющегося заказа.','You will be charged for your subscription to %1$s tomorrow.'=>'Завтра с вас будет снята плата за подписку на %1$s.','%s is active and cannot be uninstalled.'=>'%s активен и не может быть удален.','%s is not installed.'=>'%s не установлен.','%s was successfully uninstalled.'=>'%s успешно деактивирован.','Cannot uninstall "%s" type add-ons.'=>'Невозможно удалить дополнения типа "%s".','Shortcodes'=>'Шорткоды','Date when access expires. Only applicable when `access_expiration` is `limited-date`. `Format: Y-m-d H:i:s`.'=>'Дата, когда истекает срок действия доступа. Применяется только в том случае, если `access_expiration` имеет значение `limited-date`. `Формат: Y-m-d H:i:s`.','Determine the length of access from time of purchase. Only applicable when `access_expiration` is `limited-period`.'=>'Определяет продолжительность доступа с момента покупки. Применяется только в том случае, если `access_expiration` имеет значение `limited-period`.','Determine the length of access from time of purchase. Only applicable when `access_expiration` is `limited-period`'=>'Определите продолжительность доступа с момента покупки. Применяется только в том случае, если `access_expiration` имеет значение `limited-period`','Access expiration type. `lifetime` provides access until cancelled or until a recurring payment fails. `limited-period` provides access for a limited period as specified by `access_length` and `access_period` `limited-date` provides access until the date specified by access_expires_date`.'=>'Тип истечения срока действия доступа. `lifetime` предоставляет доступ до отмены или до тех пор, пока не произойдет сбой повторяющегося платежа. `limited-period` предоставляет доступ на ограниченный период, указанный в `access_length` и `access_period` `limited-date` предоставляет доступ до даты, указанной в access_expires_date`.','Billing frequency [0-6]. `0` denotes a one-time payment. `>= 1` denotes a recurring plan.'=>'Частота выставления счетов [0-6]. `0` обозначает единовременный платеж. `>= 1` обозначает повторяющийся план.','For recurring plans only. Determines the number of intervals a plan should run for. `0` denotes the plan should run until cancelled.'=>'Только для повторяющихся планов. Определяет количество интервалов, в течение которых будет выполняться план. `0` означает, что план будет выполняться до отмены.','Determines the course or membership which can be accessed through the plan.'=>'Определяет курс или членство, доступ к которому можно получить через план.','Access plan visibility.'=>'Видимость плана доступа.','Text of the "Purchase" button'=>'Текст кнопки Покупка','Must be an integer in the range 0-6'=>'Должно быть целым числом в диапазоне от 0 до 6','For recurring plans only. Determines the interval of recurring payments.'=>'Только для повторяющихся планов. Определяет интервал регулярных платежей.','WordPress page ID to use for checkout success redirection. Applicable only when `redirect_type` is page.'=>'ID страницы WordPress, которую следует использовать для перенаправления после успешной оплаты. Применимо только при условии, что `redirect_type` равно \'page\'.','Determines the redirection behavior of the user\'s browser upon successful checkout or registration through the plan. `self`: Redirect to the permalink of the specified `post_id`. `page`: Redirect to the permalink of the WordPress page specified by `redirect_page_id`. `url`: Redirect to the URL specified by `redirect_url`.'=>'Определяет поведение перенаправления браузера пользователя после успешного оформления заказа или регистрации через план. `self`: Перенаправить на постоянную ссылку указанного `post_id`. `page`: Перенаправить на постоянную ссылку страницы WordPress, указанной в `redirect_page_id`. `url`: Перенаправить на URL, указанный в `redirect_url`.','URL to use for checkout success redirection. Applicable only when `redirect_type` is `url`.'=>'URL для перенаправления после успешного оформления заказа. Применимо только при использовании `redirect_type` равным `url`.','Must be a valid course or membership ID'=>'Должен быть действительным ID курса или членства','Use this plans\'s redirect settings when purchasing a Membership this plan is restricted to. Applicable only when `availability_restrictions` exist for the plan'=>'Используйте настройки перенаправления этого плана при покупке членства, к которому ограничен этот план. Применяется только в случае наличия ограничений доступности для плана','Used to automatically end a scheduled sale. If empty, the plan remains on sale indefinitely. Only applies when `sale_enabled` is `true`. Format: `Y-m-d H:i:s`.'=>'Используется для автоматического завершения запланированной распродажи. Если значение пустое, план остается в продаже на неопределенный срок. Применяется только в том случае, если `sale_enabled` имеет значение `true`. Формат: `d.m.Y H:i:s`.','Used to automatically start a scheduled sale. If empty, the plan is on sale immediately. Only applies when `sale_enabled` is `true`. Format: `Y-m-d H:i:s`.'=>'Используется для автоматического запуска запланированной распродажи. Если пусто, план сразу же становится доступным для продажи. Применяется только при условии, что `sale_enabled` равно `true`. Формат: `d.m.Y H:i:s`.','Mark the plan as "On Sale" allowing for temporary price adjustments.'=>'Пометьте план как "В продаже", чтобы временно скорректировать цену.','Sale price. Only applies when `sale_enabled` is `true`.'=>'Цена со скидкой. Применяется только при значении `sale_enabled` равном `true`.','External identifier'=>'Внешний идентификатор','Enable a trial period for a recurring access plan.'=>'Включите пробный период для повторяющегося плана доступа.','Determines the length of trial access. Only applies when `trial_enabled` is `true`.'=>'Определяет продолжительность пробного доступа. Применяется только в том случае, если `trial_enabled` имеет значение `true`.','Determines the price of the trial period. Only applies when `trial_enabled` is `true`.'=>'Определяет стоимость пробного периода. Применяется только в том случае, если `trial_enabled` имеет значение `true`.','You are not allowed to view this student.'=>'Вам не разрешено просматривать этого студента.','You are not allowed to filter students by role.'=>'Вам не разрешено фильтровать студентов по ролям.','You are not allowed to list students.'=>'Вам не разрешается перечислять студентов.','You are not allowed to edit this student.'=>'Вам не разрешено редактировать этого студента.','Student\'s progress as a percentage.'=>'Успеваемость ученика в процентах.','Unique identifier for the student. The WP User ID.'=>'Уникальный идентификатор студента. Идентификатор пользователя WP.','Unique course, lesson, or section Identifer. The WordPress Post ID.'=>'Уникальный идентификатор курса, урока или раздела. Идентификатор поста WordPress.','Include only webhooks matching a specific status.'=>'Включите только вебхуки, соответствующие определенному статусу.','Webhook ID.'=>'ID вебхука.','The status of the webhook.'=>'Статус вебхука.','The webhook topic'=>'Тема вебхука','The webhook payload delivery URL.'=>'URL доставки полезной нагрузки вебхука.','List of WordPress action hook associated with the webhook.'=>'Список хуков действий WordPress, связанных с вебхуком.','Created date cannot be in the future.'=>'Дата создания не может быть будущей.','An optional secret key used to generate the delivery signature.'=>'Необязательный секретный ключ, используемый для создания подписи доставки.','Determines the action to take when content restricted by the membership is accessed by a non-member. - `none`: Remain on page and display the message `restriction_message`. - `membership`: Redirect to the membership\'s permalink. - `page`: Redirect to the permalink of the page identified by `restriction_page_id`. - `custom`: Redirect to the URL identified by `restriction_url`.'=>'Определяет действие, которое следует предпринять, когда доступ к содержимому, ограниченному членством, получает нечлен. - `none`: Остаться на странице и вывести сообщение `restriction_message`. - `membership`: Перенаправление на permalink членства. - `page`: Перенаправление на permalink страницы, идентифицированной по `restriction_page_id`. - `custom`: Перенаправление на URL, обозначенный `restriction_url`.','Access plan price.'=>'Цена плана доступа.','The API credentials were invalid.'=>'Учетные данные API недействительны.','Invalid or malformed request syntax.'=>'Неверный или некорректный синтаксис запроса.','The requested resource could not be found.'=>'Запрашиваемый ресурс не найден.','Internal Server Error.'=>'Внутренняя ошибка сервера.','You must belong to the [lifterlms_membership_link id="{{membership_id}}"] membership to access this content.'=>'Вы должны быть участником [lifterlms_membership_link id="{{membership_id}}"] членства, чтобы получить доступ к этому содержимому.','The WordPress page ID of the sales page. Required when `sales_page_type` equals `page`. Only returned when the `sales_page_type` equals `page`.'=>'ID страницы WordPress для страницы продаж. Требуется, когда `sales_page_type` равно `page`. Возвращается только в том случае, если `sales_page_type` равно `page`.','List of membership tags.'=>'Список меток членства.','Unique Membership Identifier. The WordPress Post ID'=>'Уникальный идентификатор участника. ID записи WordPress','Unique %1$s Identifier. The WordPress Post ID'=>'Уникальный идентификатор %1$s. ID записи WordPress','Invalid parent_id param. It must be a valid Course ID.'=>'Неверный параметр parent_id. Он должен быть действительным ID курса.','WordPress post ID of the parent item. Must be a Course ID.'=>'ID записи родительского элемента WordPress. Должен быть ID курса.','Order of the section within the course.'=>'Порядок раздела в рамках курса.','Filter sections by the parent post (course) ID.'=>'Фильтровать разделы по ID родительской записи (курса).','You are not allowed to create new students.'=>'Вам запрещено создавать новых студентов.','You are not allowed to delete this student.'=>'Вам запрещено удалять этого студента.','You are not authorized to perform this request.'=>'Вы не имеете права выполнять этот запрос.','The URL of the sales page content. Required when `sales_page_type` equals `url`. Only returned when the `sales_page_type` equals `url`.'=>'URL-адрес содержимого страницы продаж. Требуется, когда `sales_page_type` равен `url`. Возвращается только тогда, когда `sales_page_type` равен `url`.','The parsed resource from the `topic`.'=>'Разобранный ресурс из `topic`.','The parsed event from the `topic`.'=>'Разобранное событие из `topic`.','Defines alternate content displayed to visitors and non-enrolled students when accessing the post. - `none` displays the post content. - `content` displays alternate content from the `excerpt` property. - `page` redirects to the WordPress page defined in `content_page_id`. - `url` redirects to the URL defined in `content_page_url`.'=>'Определяет альтернативное содержимое, отображаемое для посетителей и незарегистрированных студентов при доступе к посту. - `none` отображает содержимое поста. - `content` отображает альтернативное содержимое из свойства `excerpt`. - `page` перенаправляет на страницу WordPress, определенную в `content_page_id`. - `url` перенаправляет на URL, определенный в `content_page_url`.','Retrieve only students enrolled in the specified course(s) and/or membership(s). Accepts a single WP Post ID or a comma separated list of IDs.'=>'Получает только студентов, зачисленных на указанный курс (курсы) и/или членство (членства). Принимается отдельный ID записи WP или список идентификаторов, разделенных запятыми.','Retrieve only students not enrolled in the specified course(s) and/or membership(s). Accepts a single WP Post ID or a comma separated list of IDs.'=>'Получает только студентов, не зачисленных на указанный курс (курсы) и/или членство (членства). Принимается отдельный ID записи WP WP или список идентификаторов, разделенных запятыми.','Message to display to non-members after a `restriction_action` redirect. When `restriction_action` is `none` replaces the page content with this message.'=>'Сообщение, отображаемое для лиц, не являющихся членами, после перенаправления `restriction_action`. Когда `restriction_action` имеет значение `none`, содержимое страницы заменяется этим сообщением.','WordPress page ID used for redirecting non-members when `restriction_action` is `page`.'=>'ID страницы WordPress, используемый для перенаправления не членов, когда `restriction_action` имеет значение `page`.','URL used for redirecting non-members when `restriction_action` is `custom`.'=>'URL, используемый для перенаправления нечленов, когда `restriction_action` имеет значение `custom`.','Associate a quiz with this lesson.'=>'Свяжите тест с этим уроком.','Determines if a quiz is enabled for the lesson.'=>'Определяет, включен ли тест для урока.','Determines lesson progression requirements related to the quiz.
							<ul>
								<li>complete: The quiz must be completed (with any grade) to progress the lesson.</li>
								<li>pass: A passing grade must be earned to progress the lesson.</li>
							</ul>'=>'Определяет требования к прохождению урока, связанные с тестом.
							<ul>
								<li>завершить: Тест должен быть завершен (с любой оценкой), чтобы продвинуться по уроку.</li>
								<li>пройти: Для прохождения урока необходимо получить проходной балл.</li>
							</ul>','The post ID of the associated quiz.'=>'ID записи связанногл теста.','Filter lessons by the parent post (section) ID.'=>'Фильтровать уроки по ID родительской записи (раздела).','Visibility of the membership in catalogs and search results.'=>'Видимость членства в каталогах и результатах поиска.','List of membership categories.'=>'Список рубрик членства.','List of post instructors. Defaults to current user when creating a new post.'=>'Список преподавателей постов. При создании нового поста по умолчанию выбирается текущий пользователь.','WordPress post ID of the parent item. Must be a Section ID. 0 indicates an "orphaned" lesson which can be edited and viewed by instructors and admins but cannot be read by students.'=>'ID записи родительского элемента WordPress. Должен быть ID раздела. 0 указывает на «брошенный» урок, который может быть отредактирован и просмотрен преподавателями и администраторами, но не может быть прочитан студентами.','WordPress post ID of the lesson\'s parent course.'=>'ID записи WordPress родительского курса урока.','Order of the lesson within its immediate parent.'=>'Порядок урока внутри его непосредственного родителя.','Determines the weight of the lesson when grading the course.'=>'Определяет вес урока при выставлении оценок за курс.','Number of days to wait before allowing access to the lesson. Applicable only when drip_method is enrollment, start, or prerequisite.'=>'Количество дней ожидания перед разрешением доступа к уроку. Применяется только при drip_method, равном enrollment, start или prerequisite.','The date and time when the lesson becomes available. Applicable only when drip_method is date. Format: Y-m-d H:i:s.'=>'Дата и время, когда урок станет доступен. Применимо только тогда, когда drop_method является датой. Формат: d.m.Y H:i:s.','Lesson ID of the prerequisite lesson.'=>'ID урока для обязательного урока.','List of courses to automatically enroll students into when they\'re enrolled into the membership.'=>'Список курсов, на которые следует авто- зачислять студентов, когда они становятся участниками программы.','Denotes a lesson that\'s publicly accessible regardless of course enrollment.'=>'Обозначает урок, доступный для всех независимо от зачисления на курс.','Determine the method with which to make the lesson content available.
					<ul>
						<li>none: Drip is disabled; the lesson is immediately available.</li>
						<li>date: Lesson is made available at a specific date and time.</li>
						<li>enrollment: Lesson is made available a specific number of days after enrollment into the course.</li>
						<li>start: Lesson is made available a specific number of days after the course\'s start date. Only available on courses with a access_opens_date.</li>
						<li>prerequisite: Lesson is made available a specific number of days after the prerequisite lesson is completed.</li>
					</ul>'=>'Определите метод, с помощью которого можно сделать содержимое урока доступным.
					<ul>
						<li>нет: Капельница отключена; урок доступен сразу.</li>
						<li>дата: Урок становится доступным в определенную дату и время.</li>
						<li>зачисление: Урок становится доступным через определенное количество дней после зачисления на курс.</li>
						<li>начало: Урок становится доступным через определенное количество дней после даты начала курса. Доступно только для курсов с датой access_opens_date.</li>
						<li>предварительное условие: Урок становится доступным через определенное количество дней после прохождения предварительного урока.</li>
					</ul>','Message displayed to visitors when attempting to enroll into a course before the enrollment_opens_date has passed.'=>'Сообщение, отображаемое посетителям при попытке записаться на курс до истечения даты enrollment_opens_date.','The ID of the student.'=>'ID студента.','Creation date. Format: `Y-m-d H:i:s`'=>'Дата создания. Формат: d.m.Y H:i:s','Date last modified. Format: `Y-m-d H:i:s`'=>'Дата последнего изменения. Формат: d.m.Y H:i:s','The status of the enrollment.'=>'Статус зачисления.','Enrollment in this course opens on [lifterlms_course_info id="{{course_id}}" key="enrollment_start_date"].'=>'Запись на этот курс открывается [lifterlms_course_info id="{{course_id}}" key="enrollment_start_date"].','The WordPress page ID of the sales page. Required when sales_page_type equals page. Only returned when the sales_page_type equals page.'=>'ID страницы WordPress для страницы продаж. Требуется, если sales_page_type равен page. Возвращается только в том случае, если sales_page_type равно page.','You are not allowed to create new instructors.'=>'Вам не разрешено создавать новых преподавателей.','You are not allowed to delete this instructor.'=>'Вы не можете удалить этого преподавателя.','Date when the course enrollment opens.
					If blank course enrollment is open until after the enrollment_closes_date has passed.
					Does not affect course content access, see access_opens_date to control course access start date.
					Format: Y-m-d H:i:s.'=>'Дата, когда открывается запись на курс.
					Если запись на курс пуста, она будет открыта до тех пор, пока не пройдет дата enrollment_closes_date.
					Не влияет на доступ к содержимому курса, для контроля даты начала доступа к курсу см. access_opens_date.
					Формат: Y-m-d H:i:s.','Cannot create existing enrollment. Use the PATCH method if you want to update an existing enrollment'=>'Невозможно создать существующее зачисление. Используйте метод PATCH, если необходимо обновить существующую запись','Sorry, you are not allowed to delete enrollments as this user.'=>'Вам не разрешено удалять регистрации в качестве этого пользователя.','The enrollment cannot be deleted.'=>'Запись не может быть удалена.','Sorry, you are not allowed to create an enrollment as this user.'=>'У вас нет разрешения на создание записи на этого пользователя.','The enrollment could not be created'=>'Запись не может быть создана','Sorry, you are not allowed to update an enrollment as this user.'=>'Вам не разрешено обновлять запись на этого пользователя.','The enrollment status could not be updated'=>'Статус записи не может быть обновлен','The enrollment creation date could not be updated'=>'Дата создания записи не может быть обновлена','Filter results to records matching the specified status.'=>'Отфильтровать результаты по записям, соответствующим указанному статусу.','The ID of the course/membership.'=>'ID курса/членства.','The enrollment trigger. Default is `any`.'=>'Триггер зачисления. По умолчанию `любой`.','You are not allowed to view this instructor.'=>'Вам запрещено просматривать этого преподавателя.','You are not allowed to list instructors.'=>'Вам не разрешается перечислять преподавателей.','You are not allowed to edit this instructor.'=>'Вам не разрешено редактировать этого преподавателя.','Invalid course_id param. It must be a valid Course ID.'=>'Неверный параметр course_id. Он должен быть действительным ID курса.','Invalid order param. It must be greater than 0.'=>'Недопустимый параметр заказа. Он должен быть больше 0.','Invalid drip_days param. It must be greater than 0.'=>'Недопустимый параметр drip_days. Он должен быть больше 0.','Unique course or membership Identifier. The WordPress Post `ID.`'=>'Уникальный идентификатор курса или членства. ID записи WordPress.','Limit results to a specific student or a list of students. Accepts a single student id or a comma separated list of student ids.'=>'Ограничьте результаты конкретным студентом или списком студентов. Принимает отдельный ID студента или список ID(ов) студентов, разделенных запятыми.','The trigger of the enrollment to act on.'=>'Триггер регистрации для действия.','When true the video_embed will be used on the course tiles (on the catalog, for example) instead of the featured image.'=>'Если установлено значение true, video_embed будет использоваться на плитках курса (например, в каталоге) вместо изображения записи.','Determines the type of sales page content to display.<br> - <code>none</code> displays the course content.<br> - <code>content</code> displays alternate content from the <code>excerpt</code> property.<br> - <code>page</code> redirects to the WordPress page defined in <code>content_page_id</code>.<br> - <code>url</code> redirects to the URL defined in <code>content_page_url</code>'=>'Определяет тип отображаемого содержимого продающей страницы.<br> – <code>отсутствует</code> отображает содержимое курса.<br> – <code>содержимое</code> отображает альтернативное содержимое из <code>отрывка</code> свойство.<br> - <code>страница</code> перенаправляет на страницу WordPress, определенную в <code>content_page_id</code>.<br> - <code>url</code> перенаправляет на URL, определенный в <code>content_page_url</code>','The URL of the sales page content. Required when <code>content_type</code> equals <code>url</code>. Only returned when the <code>content_type</code> equals <code>url</code>.'=>'URL содержимого страницы продаж. Обязательно, когда <code>content_type</code> равно <code>url</code>. Возвращается только, когда <code>content_type</code> равно <code>url</code>.','Limit results to a specific course or membership or a list of courses and/or memberships. Accepts a single post id or a comma separated list of post ids.'=>'Ограничить результаты до определенного курса или членства или списка курсов и/или членств. Принимает отдельный ID записи или список ID записей, разделенных запятыми.','Retrieve only instructors for the specified course(s) and/or membership(s). Accepts a single WP Post ID or a comma separated list of IDs.'=>'Получает только преподавателей для указанного курса(ов) и/или членства(ов). Принимается отдельный ID записи WP Post или список ID, разделенный запятыми.','Exclude instructors who do not have permissions for the specified course(s) and/or membership(s). Accepts a single WP Post ID or a comma separated list of IDs.'=>'Исключите преподавателей, у которых нет прав на указанный курс(ы) и/или членство(а). Принимается отдельный ID записи WP или список ID, разделенный запятыми.','Date when the course opens, allowing enrolled students to begin to view and interact with the restricted course content.
					If blank the course is open until after the access_closes_date has passed.
					Does not affect course enrollment, see enrollment_opens_date to control the course enrollment start date.
					Format: Y-m-d H:i:s.'=>'Дата, когда курс открывается, позволяя записавшимся студентам начать просмотр и взаимодействие с ограниченным содержимым курса.
					Если значение пустое, курс будет открыт до тех пор, пока не пройдет дата access_closes_date.
					Не влияет на зачисление в курс, см. enrollment_opens_date для контроля даты начала зачисления в курс.
					Формат: Y-m-d H:i:s.','This course opens on [lifterlms_course_info id="{{course_id}}" key="start_date"].'=>'Этот курс открывается [lifterlms_course_info id="{{course_id}}" key="start_date"].','Date when the course enrollment closes.
