					Формат: Y-m-d H:i:s.','Message displayed to visitors when attempting to enroll into a course after the enrollment_closes_date has passed.'=>'Сообщение, отображаемое посетителям при попытке записаться на курс после истечения даты enrollment_closes_date.','Enrollment in this course closed on [lifterlms_course_info id="{{course_id}}" key="enrollment_end_date"].'=>'Запись на этот курс завершилась [lifterlms_course_info id="{{course_id}}" key="enrollment_end_date"].','Message displayed to enrolled students when the course is accessed before the access_opens_date has passed.'=>'Сообщение, отображаемое зачисленным студентам, когда доступ к курсу осуществляется до истечения даты access_opens_date.','Unique identifier for the user.'=>'Уникальный идентификатор пользователя.','Display name for the user.'=>'Отображаемое имя пользователя.','First name for the user.'=>'Имя пользователя.','Last name for the user.'=>'Фамилия пользователя.','The nickname for the user.'=>'Ник пользователя.','Registration date for the user.'=>'Дата регистрации пользователя.','The role %s does not exist.'=>'Роль %s не существует.','Invalid email address.'=>'Неверный адрес e-mail.','Limit result set to posts assigned one or more statuses.'=>'Ограничить выборку до записей с одним или несколькими установленными статусами.','Status is forbidden.'=>'Статус запрещен.','The page number requested is larger than the number of pages available.'=>'Номер запрошенной страницы превышает количество имеющихся страниц.','Invalid featured media ID.'=>'Неверный ID избранного медиа.','Whether the content is protected with a password.'=>'Защищено ли содержимое паролем.','Whether the excerpt is protected with a password.'=>'Защищать ли паролем отрывок.','URL of the user.'=>'URL пользователя.','Description of the user.'=>'Описание пользователя.','Roles assigned to the user.'=>'Роли назначенные пользователю.','Password for the user (never included).'=>'Пароль пользователя (никогда не показывается).','API Keys'=>'API ключ