ого пользователя.','Sorry, you are not allowed to delete %s as this user.'=>'Вам не разрешено удалять %s от имени этого пользователя.','You must provide a valid set of columns to search into.'=>'Вы должны предоставить действительный набор столбцов для поиска.','Cannot create a new %s with a pre-defined ID.'=>'Невозможно создать новый %s с предопределенным ID.','No %s ID was supplied.'=>'Не был предоставлен %s ID.','The requested %s could not be located.'=>'Запрашиваемый %s не может быть найден.','Bypass the trash and force course deletion.'=>'Обойти корзину и принудительно удалить курс.','Post password. Required if the post is password protected.'=>'Сообщение пароля. Требуется, если сообщение защищено паролем.','Sorry, you are not allowed to create %s as this user.'=>'У вас нет разрешения на создание %s от имени этого пользователя.','API Key Details'=>'Детали ключа API','Add API Key'=>'Добавить ключи API','A friendly, human-readable, name used to identify the key.'=>'Дружественное, понятное для человека имя, используемое для идентификации ключа.','Course created'=>'Курс создан','Course updated'=>'Курс обновлен','Course deleted'=>'Курс удален','Course restored'=>'Курс восстановлен','Lesson created'=>'Урок создан','Lesson updated'=>'Урок обновлен','Lesson deleted'=>'Урок удален','Lesson restored'=>'Урок восстановлен','Membership created'=>'Членство создано','Membership updated'=>'Членство обновлено','Membership deleted'=>'Членство удалено','Membership restored'=>'Членство восстановлено','Access Plan created'=>'План доступа создан','Access Plan updated'=>'План доступа обновлен','Access Plan deleted'=>'План доступа удален','Order updated'=>'Заказ обновлен','Order deleted'=>'Заказ удален','Order restored'=>'Заказ восстановлен','Beta Version'=>'Бета-версия','Save & Update'=>'Сохранить и обновить','Are you sure you want to enable or disable beta testing for these plugins and themes?'=>'Вы уверены, что хотите включить или отключить бета-тестирование этих плагинов и тем?','T