p it. For example, we will store order information for XXX years for tax and accounting purposes. This includes your name, email address and billing address.'=>'Как правило, мы храним информацию о вас до тех пор, пока она нам нужна для целей, для которых мы ее собираем и используем, и по закону мы не обязаны продолжать её хранить. Например, мы будем хранить информацию о заказах в течение XXX лет для налоговых и бухгалтерских целей. Это включает ваше имя, email адрес и адрес для выставления счета.','Customer information like your name, email address, and billing information.'=>'Информация о клиенте, такая как ваше имя, email адрес и платежные данные.','What we share with others'=>'Какие данные мы передаём третьим сторонам','Order information like what was purchased, when it was purchased and where it should be sent, and'=>'Сведения о заказе: название купленного товара, время покупки и адрес доставки, а также','Who on our team has access'=>'У каких членов команды магазина есть доступ','Send you marketing messages, if you choose to receive them'=>'Отправлять маркетинговые сообщения, если вы решите их получать','Improve our site’s offerings'=>'Улучшать предложения на нашем сайте','When you create an account, we will store your name, address, email and phone number, which will be used to populate the enrollment and checkout for future purchases and enrollments.'=>'Когда вы создаете учетную запись, мы сохраняем ваше имя, адрес, электронную почту и номер телефона, которые будут использоваться для заполнения регистрационной формы и оформления заказа при последующих покупках и регистрациях.','Course and membership instructors can access your course progress and activities including:'=>'Преподаватели курсов и члены клуба могут получить доступ к вашему прогрессу и деятельности, в том числе:','Quiz and assignments answers and grades for their courses'=>'Ответы на тесты и задания и оценки по их курсам','Our team members have access to this information to help fulfill orders, process refunds, and support you.'=>'Наши сотрудники имеют доступ к этой информации, чтобы помогать выполнять заказы, оформлять возвраты и оказывать вам поддержку.','Course progress and status information for their courses'=>'Информация о прохождении курса и состоянии курсов','Comments and reviews made on their memberships and courses'=>'Комментарии и обзоры об их членстве и курсах','Enrollment dates for their courses and memberships'=>'Даты зачисления на курсы и членства','Set up your account for our site'=>'Настройте свой аккаунт для нашего сайта','Comply with any legal obligations we have'=>'Соблюдаем все юридические обязательства, что мы имеем','Respond to your requests, including refunds and complaints'=>'Отвечать на ваши запросы, включая возвраты и жалобы','Process payments and prevent fraud'=>'Обрабатывать платежи и предотвращать мошенничества','Send you information about your account, orders, courses, and memberships'=>'Отправлять вам информацию о вашей учетной записи, заказах, курсах и членстве','When you register an account with us, we’ll ask you to provide information including your name, billing address, email address, phone number, credit card/payment details and optional account information like username and password. We’ll use this information for purposes, such as, to:'=>'Когда вы регистрируете у нас учетную запись, мы попросим вас предоставить информацию, включая ваше имя, адрес для выставления счетов, адрес электронной почты, номер телефона, данные кредитной карты/платежа и необязательную информацию об учетной записи, такую как имя пользователя и пароль. Мы будем использовать эту информацию в таких целях, как:','Communicate with you about courses and memberships that you’re enrolled in'=>'Сообщайте вам о курсах и членствах, на которые вы зачислены','Order Number'=>'Номер заказа','User ID'=>'ID пользователя','View Certificates'=>'Смотреть сертификаты','List of all the student\'s certificates'=>'Список всех сертификатов студента','When enabled users mus