-ons are used, the specific information shared by your site will vary. We recommend consulting with a lawyer when deciding what information to disclose on your privacy policy.'=>'Этот образец формулировки включает в себя основные положения о том, какие персональные данные может собирать, хранить и передавать ваша платформа для обучения, а также о том, кто может иметь доступ к этим данным. В зависимости от того, какие настройки включены и какие дополнительные надстройки используются, конкретная информация, передаваемая вашим сайтом, будет отличаться. Мы рекомендуем проконсультироваться с юристом при принятии решения о том, какую информацию следует указывать в политике конфиденциальности.','When enabled all student data related to course and membership activities will be removed.'=>'Если эта функция включена, все данные о студентах, связанные с курсами и членством в клубе, будут удалены.','Removed all student course and membership enrollment and activity data.'=>'Удалены все данные о зачислениях на курсы и членства, а также данные об активности студента.','Retained all student course and membership enrollment and activity data.'=>'Сохранены все данные о зачислениях на курсы и членства, а также данные об активности студента.','Membership Data'=>'Данные о членстве','Billing Email'=>'Платёжный email','Template ID'=>'ID шаблона','Download'=>'Скачать','Select'=>'Выбрать','Cannot manage enrollment status for anonymized orders.'=>'Невозможно управлять статусом зачисления для анонимизированных заказов.','Subscription Cancellation Notice'=>'Уведомление об отмене подписки','This is a %2$s %1$s String'=>'Это строка %2$s %1$s','%1$s has cancelled their subscription (#%2$s) to the %3$s %4$s'=>'%1$s отменил свою подписку (#%2$s) на %3$s %4$s','%1$s subscription cancellation'=>'отмена подписки %1$s','%s Theme Settings'=>'Настройки темы %s','When enabled, students will be shown the correct answer to any question they answered incorrectly.'=>'Если включено, студентам будет показан правильный ответ на любой вопрос, на который они ответили неправильно.','Display questions in a random order for each attempt. Content questions are locked into their defined positions.'=>'Отображать вопросы в случайном порядке для каждой попытки. Вопросы с содержаниям при этом, фиксируются в определенных позициях.','Student User ID'=>'ID студента','Gateway ID'=>'ID шлюза','Payment Gateway Settings'=>'Настройки платежного шлюза','%s Payment Gateway Settings'=>'Настройки платёжного шлюза — %s','Error: "%s" is not a valid payment gateway'=>'Ошибка: "%s" не является допустимым платежным шлюзом','Student Dashboard Endpoints'=>'Конечные точки студенческой панели','Each endpoint allows students to view more information or manage parts of their account. Each endpoint should be unique, URL-safe, and can be left blank to disable the endpoint completely.'=>'Каждая конечная точка позволяет студентам просматривать дополнительную информацию или управлять частями своей учетной записи. Каждая конечная точка должна быть уникальной, безопасной с точки зрения URL-адреса, и ее можно оставить пустой, чтобы полностью отключить конечную точку.','Payment confirmation endpoint slug'=>'Ярлык конечной точки подтверждения платежа','Select a student'=>'Выберите студента','Select an Instructor'=>'Выберите преподавателя','Admin: %1$s (#%2$d)'=>'Администратор: %1$s (#%2$d)','All Time'=>'Все время','Require Passing Grade on Quiz'=>'Требуемый проходной балл теста','Require Passing Grade on Assignment'=>'Требуемый проходной балл задания','Has audio'=>'Есть аудио','No audio'=>'Нет аудио','Has video'=>'Есть видео','No video'=>'Нет видео','There\'s no assignment associated with this lesson.'=>'Нет задания, связанного с этим уроком.','Create New Assignment'=>'Создать новое задание','Add Existing Assignment'=>'Добавить существующее задание','Assignment'=>'Задание','Open WordPress lesson editor'=>'Открыть редактор урока WordPress','Add an assignment'=>'Добавить задание','Add a quiz'=>'Добавить тест','Drip di