d'=>'Запустить мастер настройки','Features'=>'Возможности','This page is where your visitors will find a list of all your available courses. %1$sMore Information%2$s'=>'На этой странице посетители найдут список всех доступных курсов. %1$sДополнительная информация%2$s','LifterLMS Memberships Catalog'=>'Каталог членства LifterLMS','Memberships Catalog'=>'Каталог членства','To show all memberships on one page, enter -1'=>'Чтобы показать все членства на одной странице, введите -1','Determines the display order for items on the memberships page.'=>'Определяет порядок отображения элементов на странице членства.','Memberships Sorting'=>'Сортировка членства','Select a membership'=>'Выберите членство','Memberships per page'=>'Членства на странице','Email Address'=>'Email-адрес','There was a problem deleting your access plan, please try again.'=>'При удалении плана доступа произошла ошибка. Повторите попытку.','There was an error removing the course, please try again.'=>'Произошла ошибка при удалении курса, попробуйте еще раз.','Please enter a coupon code.'=>'Введите код купона.','Please enter a plan ID.'=>'Введите ID плана.','There was an error loading the necessary resources. Please try again.'=>'Ошибка загрузки необходимых ресурсов. Попробуйте еще раз.','Email Subject'=>'Тема письма','Email Heading'=>'Заголовок письма','Select a Quiz'=>'Выбрать тест','Free Lesson'=>'Бесплатный урок','Drip Settings'=>'Настройки задержки','Restricted Access Redirect'=>'Перенаправление ограничения доступа','Stay on page'=>'Остаться на странице','Display a Message'=>'Отобразить сообщение','Shortcodes like %s can be used in this message'=>'Шорткоды, например %s, могут быть использованы в данном сообщение','Course Name'=>'Название курса','Check this box to output a message after redirecting. If no redirect is selected this message will replace the normal content that would be displayed.'=>'Установите этот флажок, чтобы вывести сообщение после перенаправления. Если переадресация не выбрана, это сообщение заменит стандартное содержимое, могло бы отображаться.','This is the heading for your email. It will display above the content.'=>'Это заголовок вашего письма. Он будет отображен над содержимым.','You must belong to the %s membership to access this content.'=>'Вы должны быть держателем тарифного плана %s, чтобы получить доступ к содержимому.','Redirect to this membership page'=>'Перенаправление на страницу тарифных планов','Featured Video'=>'Сопутствующее видео','Paste the url for a Wistia, Vimeo or Youtube video or a hosted video file. For a full list of supported providers see %s.'=>'Вставьте ссылку на видео с Wistia, Vimeo, Youtube или файла размещённого на вашем хостинге. Полный список поддерживаемых провайдеров см. %s.','Featured Audio'=>'Сопутствующее аудио','Paste the url for a SoundCloud or Spotify song or a hosted audio file. For a full list of supported providers see %s.'=>'Вставьте ссылку на песню в SoundCloud или Spotify или на аудиофайл размещенный на хостинге. Полный список поддерживаемых провайдеров см. %s.','You must enroll in this course to access course content.'=>'Вы должны быть зачислены на этот курс, чтобы получить доступ к его содержимому.','This message will be displayed when non-enrolled visitors attempt to access course content directly without enrolling first'=>'Это сообщение будет отображаться, когда незарегистрированные посетители пытаются получить доступ к содержимому курса напрямую без предварительного зачисления','Content Restricted Message'=>'Сообщение о закрытом содержимом','Set registration start and end dates for this course'=>'Установите даты начала и окончания регистрации на этот курс','Registration opens on this date.'=>'В эту дату начинается регистрация.','Enrollment Start Date'=>'Начало зачисления','Registration closes on this date.'=>'В эту дату заканчивается регистрация.','Enrollment End Date'=>'Дата окончания зачисления','Enrollment in this course opens on [lifterlms_course_info id="%d" key="enrollment_start_date"].'=>'Зачисление на курс открывается [lifterlms_course_info id="%d" key="enrollment_start_date"].','This message will be displayed to non-enrolled visitors before the Enrollment Start Date. You may use shortcodes like [lifterlms_course_info id="%d" key="enrollment_start_date"] in this message.'=>'Сообщение будет показано не зачисленным посетителям до даты начала зачисления. В этом сообщение вы можете использовать шорткоды, такие как [lifterlms_course_info id="%d" key="enrollment_start_date"]','Enrollment Opens Message'=>'Сообщение об открытии зачисления','Enrollment in this course closed on [lifterlms_course_info id="%d" key="enrollment_end_date"].'=>'Завчисление на курс закрыто [lifterlms_course_info id="%d" key="enrollment_end_date"].','This message will be displayed to non-enrolled visitors once the Enrollment End Date has passed. You may use shortcodes like [lifterlms_course_info id="%d" key="enrollment_end_date"] in this message.'=>'Сообщение будет показано не зачисленным посетителям после даты окончания зачисления. В этом сообщение вы можете использовать шорткоды, такие как [lifterlms_course_info id="%d" key="enrollment_start_date"]','Enrollment Closed Message'=>'Сообщение о закрытии зачисления','Enable Course Time Period'=>'Включить периодичность курса','Set start and end dates for this course. Content can only be viewed and completed within the selected range.'=>'Установите даты начала и окончания курса. Содержимое может быть просмотрено и пройдено только в пределах выбранного диапазона дат.','Course Start Date'=>'Дата нача курса','Course End Date'=>'Дата завершения курса','This course opens on [lifterlms_course_info id="%d" key="start_date"].'=>'Курс открывается [lifterlms_course_info id="%d" key="start_date"].','This message will be displayed to non-enrolled visitors before the Course Start Date. You may use shortcodes like [lifterlms_course_info id="%d" key="start_date"] in this message.'=>'Сообщение будет показано не зачисленным посетителям до даты начала курса. В этом сообщение вы можете использовать шорткоды, такие как [lifterlms_course_info id="%d" key="enrollment_start_date"]','Course Opens Message'=>'Сообщение об открытии курса','This course closed on [lifterlms_course_info id="%d" key="end_date"].'=>'Курс закрыт [lifterlms_course_info id="%d" key="end_date"].','This message will be displayed to non-enrolled visitors once the Course End Date has passed. You may use shortcodes like [lifterlms_course_info id="%d" key="end_date"] in this message.'=>'Сообщение будет показано не зачисленным посетителям после даты окончания курса. В этом сообщение вы можете использовать шорткоды, такие как [lifterlms_course_info id="%d" key="enrollment_start_date"]','Course Closed Message'=>'Сообщение о закрытии курса','Enable Prerequisite'=>'Включить условия','Select a prerequisite course. Students must have completed the selected course before they can view or complete content in this course.'=>'Выберите обязательный к изучению курс. Студенты должны пройти выбранный курс, прежде чем они смогут просмотреть или завершить этот.','Choose Prerequisite Course'=>'Выберите курс обязательный к просмотру','Enable Course Capacity'=>'Включить вместимость курса','Course Capacity'=>'Вместимость курса','This message will be displayed to non-enrolled visitors once the Course Capacity has been reached. '=>'Это сообщение будет отображаться не зачисленным посетителям, как только будет достигнута вместимость курса. ','Capacity Reached Message'=>'Сообщение о заполнении курса','Video Embed Url'=>'Ссылка на встраиваемое видео','Audio Embed Url'=>'Ссылка на встраиваемое аудио','Enable to choose a prerequisite Lesson'=>'Включите, чтобы выбрать предшествующий урок','Select a Prerequisite Lesson'=>'Выберите обязательный к изучению урок','Select the prerequisite lesson'=>'Выберите обязательный к изучению урок','Choose Prerequisite'=>'Выберите предыдущий','Date Available'=>'Дата доступности','Optionally enter a time when the lesson should become available. If no time supplied, lesson will be available at 12:00 AM. Format must be HH:MM AM'=>'При желании введите время в которое урок должен стать доступным. Если время не указано, урок будет доступен в 12:00. Формат должен быть 12-часовой ЧЧ:ММ AM','Time Available'=>'Время доступности','Redirect to a WordPress page'=>'Перенаправить на страницу WordPress','Redirect to a Custom URL'=>'Перенаправить на произвольный URL','Select a WordPress Page'=>'Выберите страницу WordPress','Enter a Custom URL'=>'Введите произвольную ссылку','Drip Method'=>'Метод задержки','This content will only be shown to visitors who are not enrolled in this course.'=>'Это содержимое будет показан только тем посетителям, которые не зачислены на этот курс.','Course Difficulty Category'=>'Рубрика сложности курса','Prerequisites'=>'Подготовительные','Select a course'=>'Выберите курс','This content will only be shown to visitors who are not enrolled in this membership.'=>'Это содержимое будет показан только тем посетителям, которые не являются участниками данного членства.','Restricted Content Notice'=>'Сообщение ограничения содержимого','Select the prerequisite course track. Students must have completed the select track before they can view or complete content in this course.'=>'Выберите необходимое направление курса, Студенты должны пройти выбранную учебную программу, прежде чем они смогут просмотреть или завершить этот курс.','Choose Prerequisite Course Track'=>'Выберите направление предварительного курса','Enable Enrollment Period'=>'Включить период зачисления','Enrollment has closed because the maximum number of allowed students has been reached.'=>'Зачисление закрыто, поскольку достигнуто макс. допустимое кол-во студентов.','Auto Enrollment'=>'Авто-зачисление','Checking this box will allow guests to view the content of this lesson without registering or signing up for the course.'=>'Установка этого флажка позволит гостям просматривать содержимое этого урока без регистрации или зачисления на курс.','A Trial Discount Amount was not supplied. Trial Pricing Discount has automatically been disabled. Please re-enable Trial Pricing Discount and enter a Trial Discount Amount, then save this coupon again.'=>'Сумма скидки для пробного периода не была обозначена. Скидка на тестовый период автоматически отключена. Включите скидку пробного периода повторно и введите сумму этой скидки, а затем сохраните этот купон еще раз.','When a non-member attempts to access content restricted to this membership'=>'Когда лицо, не являющееся членом, пытается получить доступ к содержимому, доступному только этому членству','Allow'=>'Разрешить','Save & Continue'=>'Сохранить и продолжить','No thanks'=>'Нет, спасибо','Welcome!'=>'Добро пожаловать!','Page Setup'=>'Настройка страницы','Get Started Now'=>'Начать сейчас','By allowing us to collect non-sensitive usage information and diagnostic data, you\'ll be providing us with information we can use to make the future of LifterLMS stronger and more powerful with every update!'=>'Позволяя нам собирать информацию об использовании и диагностические данные, вы предоставляете нам возможность улучшить работу LifterLMS, чтобы он становился более сильным и мощным с каждым обновлением!','Click "Allow" to and we\'ll send you a coupon immediately.'=>'Кликните "Разрешить" и мы отправим вам купон немедленно.','Thanks for choosing LifterLMS to power your online courses! This short setup wizard will guide you through the basic settings and configure LifterLMS so you can get started creating courses faster!'=>'Спасибо, что выбрали LifterLMS для создания онлайн-курсов! Этот быстрый мастер настройки поможет вам с основными настройками LifterLMS, чтобы вы могли быстрее начать создавать курсы!','It will only take a few minutes and it is completely optional. If you don\'t have the time now, come back later.'=>'Это займет всего несколько минут, и это совершенно необязательно. Если у вас нет времени, вы всегда можете вернуться позже.','LifterLMS has a few essential pages. The following will be created automatically if they don\'t already exist.'=>'Для работы LifterLMS должны быть созданы несколько важных страниц. Следующие страницы будут созданы автоматически, если они еще не существуют.','Course Catalog'=>'Каталог курсов','After setup, you can manage these pages from the admin dashboard on the %1$sPages screen%2$s and you can control which pages display on your menu(s) via %3$sAppearance > Menus%4$s.'=>'После настройки вы можете управлять этими страницами из панели управления администратора в разделе %1$sСтраницы%2$s. Также вы можете контролировать, какие страницы отображаются в вашем меню через вкладку %3$sВнешний вид > Меню%4$s.','Which country should be used as the default for student registrations?'=>'Какую страну следует использовать по умолчанию для регистрации студентов?','Which currency should be used for payment processing?'=>'Какую валюту следует использовать по умолчанию для процесса оплаты?','Enable Offline Payments'=>'Включить офлайн-платежи','apply membership restriction to post typeRestrict this %s'=>'Ограничить %s','Achievement Title'=>'Название достижения','Discount Type'=>'Тип скидки','Any Access Plan'=>'Любой план доступа','Restrictions'=>'Ограничения','Coupon code already exists. Customers will use the most recently created coupon with this code.'=>'Код купона уже существует. Клиенты будут использовать последний созданный купон с этим кодом.','With LifterLMS you can accept both online and offline payments. Be sure to install a %1$spayment gateway%2$s to accept online payments.'=>'С LifterLMS вы можете принимать как онлайн, так и оффлайн-платежи. Обязательно установите %1$sплатежный шлюз%2$s для приема онлайн-платежей.','ID#'=>'ID#','Visitors must belong to one of these memberships to access this %s'=>'Посетители должны являться держателями тарифных планов для доступа к %s','This is the page where visitors will be directed in order to pay for courses and memberships.'=>'На эту страницу посетители сайта будут пер